import React from 'react'

const Contact = ({val,handleDelete}) => {
  const {id,fname,lname,phone} = val;

  return (
    <React.Fragment>
        <p>
          <h1>fname</h1><span>{fname}</span>
          <h1>lname</h1><span>{lname}</span>
          <h1>phone</h1><span>{phone}</span>
        </p>    
        
    </React.Fragment>
  )
}

export default Contact
